import React, { useState } from 'react';

const StudentForm = ({ onSave }) => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [studentId, setStudentId] = useState('');
  const [startDate, setStartDate] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate form data here if needed

    // Call the onSave function with the form data
    onSave({ name, email, studentId, startDate });

    // Reset form fields after submission
    setName('');
    setEmail('');
    setStudentId('');
    setStartDate('');
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="mb-3">
        <label htmlFor="name" className="form-label">Name</label>
        <input type="text" className="form-control" id="name" value={name} onChange={(e) => setName(e.target.value)} required />
      </div>
      <div className="mb-3">
        <label htmlFor="email" className="form-label">Email</label>
        <input type="email" className="form-control" id="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
      </div>
      <div className="mb-3">
        <label htmlFor="studentId" className="form-label">Student ID</label>
        <input type="text" className="form-control" id="studentId" value={studentId} onChange={(e) => setStudentId(e.target.value)} required />
      </div>
      <div className="mb-3">
        <label htmlFor="startDate" className="form-label">Start Date</label>
        <input type="date" className="form-control" id="startDate" value={startDate} onChange={(e) => setStartDate(e.target.value)} required />
      </div>
      <button type="submit" className="btn btn-primary">Save</button>
    </form>
  );
};

export default StudentForm;
